import Navbar from './Components/Navbar/Navbar';
import './App.css';
import {
  createBrowserRouter,
  RouterProvider,
} from "react-router-dom";
function App() {
  const router = createBrowserRouter([
    {
      path: "/",
      element: <div>Hello world!</div>,
    },
  ]);
  return (
    <div className="App">
     <RouterProvider router={router} />  
    </div>
  );
}

export default App;
